sources.styles/utils/_normalize.scss:
p,
a,
h1,
h2,
h3 {
  margin: 0;
  padding: 0;
}

sources.styles/blocks/page.scss:
.page {
  &__body {
    background-color: $c-gray;
    box-sizing: border-box;
    margin: 0;
    font-family: "Inter", sans-serif;
    font-weight: 400;
    font-style: normal;
    position: relative;
    scroll-behavior: smooth;
  }

  &__welcome {
    margin-bottom: 64px;
  }

  &__we-bake {
    @include onTablet {
      margin-bottom: 98px;
    }

    @include onDesktop {
      margin-bottom: 124px;
    }
  }
}

sources.styles/blocks/nav.scss:
.nav {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 20px;

  @include onDesktop {
    padding: 32px;
  }
}

sources.styles/blocks/logo.scss:
.logo {
  height: 24px;
  width: 128px;
  margin-right: 2px;

  @include onDesktop {
    margin-right: 4px;
  }

  &--footer {
    height: 30px;
    width: 158px;
    margin-left: 5px;
  }

  &__img {
    width: 100%;
    height: 100%;
  }

  &__link {
    display: block;
  }
}

sources.styles/blocks/icon.scss:
.icon {
  width: 20px;
  height: 20px;
  background-position: center;
  background-repeat: no-repeat;
  background-size: contain;

  &--menu {
    background-image: url(../images/menu_mobile.svg);
  }

  &--cross {
    background-image: url(../images/menu_cross.svg);
  }

  @include onDesktop {
    display: none;
  }
}

sources.styles/blocks/hero.scss:
.hero {
  padding: 0 0 40px;

  &__about {
    color: #1c1a26;
    font-size: 16px;
    text-align: center;
    line-height: 150%;
    letter-spacing: -0.01em;
    padding: 32px 0;
  }

  &__moto {
    font-size: 64px;
    font-weight: 400;
    line-height: 85%;
    text-align: center;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: #1c1a26;
  }

  &__img {
    width: 100%;
  }
}

sources.styles/blocks/menu.scss:
.menu {
  position: fixed;
  background-color: #eef7ff;
  height: 100vh;
  left: 0;
  right: 0;
  top: 0;
  transform: translateX(-100%);

  &:target {
    transform: translateX(0);
  }

  &__list {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
  }
}

sources.styles/blocks/list.scss:
.list {

  @include onMobile {
    display: none;
  }

  @include onDesktop {
    display: flex;
  }

  margin: 0;
  padding: 0;
  list-style-type: none;

  &--menu {
    display: grid;
    grid-template-columns: 1fr;
    justify-content: center;
    align-items: center;
    gap: 24px;
  }
  &__link {
    display: block;
    text-decoration: none;
    margin-left: 64px;
    text-align: center;
    font-size: 16px;
    line-height: 150%;
    letter-spacing: -0.01em;
    color: #1c1a26;

    &--menu {
      margin-left: 0;
    }

    &--last {
      color: #f9512e;
      height: 100%;
      display: flex;
      justify-content: center;
      align-items: center;
      letter-spacing: 0.02em;
      text-transform: uppercase;
      font-weight: 500;
      line-height: 100%;

      &::before {
        content: "";
        display: block;
        width: 18px;
        height: 18px;
        margin-right: 6px;
        background-image: url(../images/red_phone.png);
        background-repeat: no-repeat;
        background-position: center;
        background-size: cover;
      }
    }
  }
}

sources.styles/blocks/button.scss:
.button {
  height: 56px;
  box-sizing: border-box;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  border: 2px solid #f9512e;
  border-radius: 32px;

  font-weight: 500;
  font-size: 16px;
  line-height: 100%;
  color: #f9512e;
  letter-spacing: 0.02em;
  text-transform: uppercase;
  text-decoration: none;

  &::before {
    content: "";
    display: block;
    width: 20px;
    height: 20px;
    margin-right: 6px;
    background-image: url(../images/button_cookie_norm.svg);
  }

  &:hover {
    background-color: #f9512e;
    color: #fff;

    &::before {
      content: "";
      display: block;
      width: 20px;
      height: 20px;
      margin-right: 6px;
      background-image: url(../images/button_cookie_hover.svg);
    }
  }

  &:focus {
    background-color: #b3341a;
    color: #fff;
    border-color: #b3341a;

    &::before {
      content: "";
      display: block;
      width: 20px;
      height: 20px;
      margin-right: 6px;
      background-image: url(../images/button_cookie_hover.svg);
    }
  }
}

sources.styles/blocks/title.scss:
.title {
  font-size: 48px;
  line-height: 85%;
  letter-spacing: -0.05em;
  text-transform: uppercase;
  color: #1c1a26;
  font-weight: 400;
}

sources.styles/blocks/grid.scss:
.grid {
  justify-content: center;
  @include onTablet {
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    gap: 24px;
  }
  @include onDesktop {
    grid-template-columns: repeat(8, 1fr);
  }

  @for $start from 1 through 8 {
    @for $end from $start through 8 {

      &--#{$start}-#{$end} {
        display: block;
        @include onDesktop {
          grid-column: #{$start} / #{$end + 1};
        }
      }
    }
  }
}

sources.styles/blocks/sweets.scss:
.sweets {

  &__photo {
    margin-bottom: 16px;
  }
  &__img {
    width: 100%;
    border-radius: 8px;
  }

  &__category {
    display: block;
    font-size: 16px;
    font-weight: 500;
    line-height: 100%;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: #7f8096;
    text-decoration: none;
    margin-bottom: 8px;

    &:hover {
      color: #f9512e;
    }
  }

  &__about {
    font-size: 16px;
    line-height: 150%;
    letter-spacing: -0.01em;
    color: #1c1a26;
    margin-bottom: 24px;
  }

  &__order {
    font-weight: 500;
    font-size: 16px;
    line-height: 100%;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: #f9512e;
    display: flex;
    width: max-content;
    text-decoration: none;
    margin-bottom: 8px;

    &:hover {
      font-weight: bold;
      text-decoration: underline;
    }

    &::before {
      content: "";
      display: inline-block;
      width: 16px;
      height: 16px;
      margin-right: 8px;
      background-image: url(../images/before_arrow.svg);
      background-position: center;
      background-repeat: no-repeat;
      background-size: contain;
    }
  }
}

sources.styles/blocks/about.scss:
.about {
  position: relative;

  @include onTablet {
    padding-bottom: 150px;
  }

  @include onDesktop {
    padding-bottom: 350px;
  }

  &__back-ground {
    background-image: url(../images/Crumbs.png);
    background-repeat: no-repeat;
    background-position: center;
    background-size: contain;

    position: absolute;
    left: -16px;
    right: -16px;
    bottom: 160px;
    height: 300px;
    z-index: -1;

    @include onTablet {
      height: 500px;
      width: 500px;
      left: 50%;
      top: 50%;
      transform: translate(-50%, -50%);
    }

    @include onDesktop {
      width: 700px;
      height: 700px;
      bottom: 56px;
      right: 113px;
    }
  }

  &__title {
    margin-bottom: 32px;
  }

  &__text {
    margin-bottom: 64px;
  }

  &__about-us {
    display: block;
    @include onTablet {
      display: grid;
      gap: 24px;
      grid-template-columns: repeat(2, 1fr);
    }
  }

  &__pross {
    display: grid;
    gap: 48px;

    @include onTablet {
      grid-template-columns: repeat(2, 1fr);
      gap: 80px 24px;
    }

    @include onDesktop {
      grid-template-columns: repeat(4, 1fr);
    }
  }

  &__value {
    font-weight: 400;
    font-size: 96px;
    line-height: 85%;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: #1c1a26;

    margin-bottom: 8px;
  }

  &__name-value {
    font-size: 16px;
    line-height: 150%;
    letter-spacing: -0.01em;
    color: #7f8096;
  }
}

sources.styles/blocks/footer.scss:
.footer {
  display: grid;
  gap: 40px;
  padding: 60px 16px 56px;

  background-color: #1c1a26;

  &__nav:first-child {
    margin-bottom: 64px;
  }
  &__logo {
    margin-bottom: 44px;

    @include onTablet {
      margin-bottom: 108px;
    }
  }

  &__sub-title {
    font-size: 16px;
    font-weight: 500;
    line-height: 100%;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: #7f8096;
  }

  &__link {
    color: #fff;
    text-decoration: none;
    display: block;
  }

  &__menu-list {
    display: grid;
    gap: 16px;

    &--call {
      margin-bottom: 40px;
      @include onDesktop {
        margin-bottom: 0;
      }
    }

    &--email {
      @include onDesktop {
        display: flex;
        flex-direction: column;
      }
    }
  }

  &__contact-us {
    font-size: 48px;
    font-weight: 400;
    line-height: 85%;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: #fff;
    padding: 3px;
    margin-bottom: 40px;

    @include onTablet {
      font-size: 56px;
      max-width: 330px;
    }
  }

  &__social {
    display: inline-block;

    &:nth-child(2) {
      margin: 0 35px;
    }
  }

  &__social:hover > svg > .svg {
    fill: #fff;
  }

  &__all-rights {
    font-size: 16px;
    line-height: 150%;
    letter-spacing: -0.01em;
    color: #7f8096;
  }

  &__communication {

    @include onDesktop {
      display: grid;
      grid-template-columns: repeat(2, 1fr);
    }
  }
}
